import React from "react";
import "../Css/index.css";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import { Nav, Row, Col, Badge, Container } from "react-bootstrap";

import Login from "./SignIn";
import SignUp from "./SignUp";
import { connect } from "react-redux";

function SignInSignUpRouter() {
    function test(values) {
        console.log(values);
    }
    function login(values) {
        console.log(values);
    }
    return (
        // align-items-center
        <Container className="h-100">
            <Row
                className="justify-content-center h-100 "
                style={{ marginTop: "5rem" }}
            >
                <Col md={6}>
                    <Router>
                        <Nav
                            fill
                            variant="tabs"
                            className="justify-content-end  navbar-dark bg-dark"
                        >
                            <Nav.Item>
                                {" "}
                                <Link className="nav-link" to={"/sign-in"}>
                                    <h3>
                                        <Badge variant="dark">Login</Badge>
                                    </h3>
                                </Link>
                            </Nav.Item>
                            <Nav.Item>
                                <Link className="nav-link" to={"/sign-up"}>
                                    <h3>
                                        <Badge variant="dark">Sign Up</Badge>
                                    </h3>
                                </Link>
                            </Nav.Item>
                        </Nav>

                        <Switch>
                            <Route
                                exact
                                path="/"
                                // component={
                                //     <Login {...props} onSubmit={test}></Login>
                                // }
                                render={(props) => {
                                    return (
                                        <Login
                                            {...props}
                                            onSubmit={login}
                                        ></Login>
                                    );
                                }}
                            />
                            <Route
                                path="/sign-in"
                                // component={Login}
                                render={(props) => {
                                    return (
                                        <Login
                                            {...props}
                                            onSubmit={test}
                                        ></Login>
                                    );
                                }}
                            />
                            <Route
                                path="/sign-up"
                                // component={SignUp}
                                render={(props) => {
                                    return (
                                        <SignUp
                                            {...props}
                                            onSubmit={test}
                                        ></SignUp>
                                    );
                                }}
                            />
                        </Switch>
                    </Router>
                </Col>
            </Row>
        </Container>
    );
}
const mapStateToProps = (state) => ({});

const mapDispatchToProps = {};

export default connect(mapStateToProps, mapDispatchToProps)(SignInSignUpRouter);
